import{BroweserRouters as Router,Routes,Route,link, Link} from 'react-router-dom'

import Navi from "./Testing";
import Chinn from "./Testing2";

function Main(){
    return(
        <div>
            <Router>

                <Routes>
                    <Route path='hello' element={<Navi/>}/>
                    <Route path='word' element={<Chinn/>}/>
                </Routes>

            </Router>
           
        </div>
    )
}
export default  Main;
